script: |
  super -f text -I q3343.spq | sort > q3343.out

inputs:
  - name: q3343.spq
    data: |
      SELECT ALL - col2 + - col0 FROM tab2 (FORMAT parquet) cor0 WHERE col2 NOT IN ( - 39 * - + 40 * + col1 * col1 * col0 + 66, col0 * + col0 * - col0 * col1 );
  - name: tab2

outputs:
  - name: q3343.out
    data: |
      -104
      -133
      -69
